import {
  FloatingLabelInput,
} from "@/components/FloatingLabelInput/FloatingLabelInput";

const meta = {
  title: "UI/FloatingLabelInput",
  component: FloatingLabelInput,
  parameters: {
    backgrounds: {
      default: "white",
      values: [
        {
          name: "white",
          value: "#fff",
        },
        {
          name: "theme",
          value: "#6a44c8",
        },
      ],
    },
  },
} satisfies Meta<typeof Input>;
